import logo from './logo.svg';
import './App.css';
import Headline from './Modules/Headline.js'
import Footer from './Modules/Footer.js'
import MainPage from './Modules/Pages/MainPage.js'
import SideBar from './Components/SideBar.js'

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState } from "react";
// import Detail from "./routes/Detail";
// import Home from "./routes/Home";
// import Error from "./routes/Error";



function App() {

  const [sideBarOpened , SetSideBarOpened] = useState(false);


  return (
    <div className="App">
      <Headline toggleFunc = {()=>{SetSideBarOpened(cur => {!cur})}} ></Headline>
      <div
      style={{
        display: "flex",
      }}>
        <SideBar IsOpened = {sideBarOpened}></SideBar>
        <Router>
          <Routes>
            <Route path = "/*" element={ <MainPage className = "App-header"></MainPage>}/>
          </Routes>
        </Router>
      </div>
      <Footer></Footer>
    </div>
  );
}


export default App;
